DELIMITER $$
CREATE TRIGGER `update_trigger` BEFORE UPDATE ON `virtual_transaction` FOR EACH ROW BEGIN
 DECLARE s_id integer;
 DECLARE u_id integer;
 DECLARE price float;
 DECLARE qnty integer;
 DECLARE total float; 
SELECT shop_id INTO s_id FROM view_transaction WHERE order_id=NEW.transaction_id;
SELECT user_id INTO u_id FROM view_transaction WHERE order_id=NEW.transaction_id;
SELECT sell_rate INTO price FROM stock WHERE stock_id=(SELECT stock_id FROM view_transaction WHERE order_id=NEW.transaction_id); 
SELECT quantity INTO qnty FROM view_transaction WHERE order_id=NEW.transaction_id ; 
set total := qnty * price;
IF (NEW.status = '1' ) THEN
	UPDATE user set balance= 			balance+total WHERE uniqueID=
    (SELECT seller_id FROM shop WHERE
     shop_id=s_id);
ELSEIF (NEW.status = '-1' ) THEN
	UPDATE user set balance= 				balance+total WHERE id=u_id;
    UPDATE stock set 		availability=availability+qnty WHERE stock_id=NEW.stock_id;
END IF;
END
$$
DELIMITER ;

